import React,{useState} from "react";
import Button from "../UI/Button";
import Card from "../UI/Card";
import classes from './AddUser.module.css'

const AddUser = (props) => {

const[entredUsername, setEntredUsername] = useState('');
const[entredId, setEntredId] =useState('');

const addUserHandler = (event) => {
    event.preventDefault();
  };

  const usernameChangeHandler =(event)=>{
setEntredUsername(event.target.value);
  };

  const idChangeHandler=(event)=>{
    setEntredId(event.target.value);
  }

  return (   
   <Card className={classes.input}>
     <form onSubmit={addUserHandler}>
    <label htmlFor="username">UserName</label>
    <input id="username" type="text" onChange={usernameChangeHandler} />
    <label htmlFor="age"> Age (Years)</label>
    <input id="age" type="number" onChange={idChangeHandler}></input>
    <Button type="submit">Add User</Button>
  </form>
  </Card> 
  );
};

export default AddUser;
